module.exports = JSON.parse("{\"model_3\":{\"TEST-RESET_DAS\":{\"name\":\"Reset DAS\",\"task\":\"TEST-RESET_DAS\",\"description\":\"Reset the DAS ecu immediately.\",\"inputs\":[],\"usr_impact\":\"WARNING! Interrupts backup camera, autopilot and dashcam.\"},\"TEST-BASH_ICE_X_UPDATER-STATUS\":{\"name\":\"Check Updater Status\",\"task\":\"TEST-BASH_ICE_X_UPDATER-STATUS\",\"description\":\"Check the status directly on an updater. This returns firmware package data including signatures, fail counts, fuse state and more. Ensure the target updater is awake before running this.\",\"inputs\":[\"'targetUpdater' is the host whose status will be returned.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-UI-ALERTS\":{\"name\":\"Check UI Alerts\",\"task\":\"TEST-BASH_ICE_X_SEARCH-UI-ALERTS\",\"description\":\"Check recent syslogs for all UI alerts. Some alerts are benign, such as seatbelt reminders, but others may represent service concerns. This Task will find all UI alerts along with when each occurred. Note that these timestamps are always PDT.\",\"inputs\":[\"'numFiles' is the number of log files to search through. Use 'List Syslogs' to narrow down the time period, fewer logs is faster. Logs start with the most recent.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-SYSLOGS\":{\"name\":\"Search Syslogs\",\"task\":\"TEST-BASH_ICE_X_SEARCH-SYSLOGS\",\"description\":\"Search recent syslogs for a keyword or pattern. This Task is optimized for very specific keywords and should not be used for broad queries such as 'bluetooth' or 'modem'. Note that these timestamps are always PDT.\",\"inputs\":[\"'directory' is the location of the syslogs to search. /var/log/syslog is the default, but anything is /var/log is allowed.\",\"'numFiles' is the number of log files to search through. Use 'List Syslogs' to narrow down the time period, fewer logs is faster. Logs start with the most recent.\",\"'parameters' is an optional input for advanced users, it's best to leave it as default\",\"'search' is the keyword or pattern to search for, such as 'connection timed out' or 'crashing QtCar'. Special characters will be rejected by the vehicle.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-PANICLOG\":{\"name\":\"Search a Paniclog\",\"task\":\"TEST-BASH_ICE_X_SEARCH-PANICLOG\",\"description\":\"Search one panic log for a keyword or pattern.\",\"inputs\":[\"'inputArgs' is an optional input for advanced users, it's best to leave it as default\",\"'inputFile' is the name of the panic log to read, such as 'kernel-panic-20180506183204-2.tgz'. Do not include the path.\",\"'inputPattern' is the key word or expression to search for, such as 'Fatal exception' or 'OOPS'. Special characters will be rejected by the vehicle.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-CRASHLOG\":{\"name\":\"Search a Crashlog\",\"task\":\"TEST-BASH_ICE_X_SEARCH-CRASHLOG\",\"description\":\"Search one UI process crashlog for a keyword or pattern.\",\"inputs\":[\"'inputArgs' is an optional input for advanced users, it's best to leave it as default\",\"'inputFile' is the name of the crashlog to read. Use 'List Crashlogs' to find files. Do not include the path.\",\"'inputPattern' is the key word or expression to search for, such as 'ASSERTION FAILED' or 'Lost connection to gateway'. Special characters will be rejected by the vehicle.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_READ-VAR-PARAMS\":{\"name\":\"Check Var Data\",\"task\":\"TEST-BASH_ICE_X_READ-VAR-PARAMS\",\"description\":\"Read the parameters from the ICE filesystem's /var metablock. This will provide insight into filesystem-related issues such as insufficient inodes or disk space. The most helpful result is the 'Free Inodes' line which should show a number over 10,000.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_READ-HOME-PARAMS\":{\"name\":\"Check Home Data\",\"task\":\"TEST-BASH_ICE_X_READ-HOME-PARAMS\",\"description\":\"Read the parameters from the ICE filesystem's /home metablock. This will provide insight into filesystem-related issues such as insufficient inodes or disk space. The most helpful result is the 'Free Inodes' line which should show a number over 10,000.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LSUSB\":{\"name\":\"Check USB devices\",\"task\":\"TEST-BASH_ICE_X_LSUSB\",\"description\":\"Check for any connected and mounted USB devices. Note that while the display is off, external devices may not be mounted.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LS\":{\"name\":\"List Directory Contents\",\"task\":\"TEST-BASH_ICE_X_LS\",\"description\":\"List the contents of a directory. This is flexible and may be used to explore the filesystem. However, this Task has limited permissions and will not be able to read all directories.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\",\"'inputDirectory' is the directory to list. This must be an absolute path and does not support any special characters. This can list crashlogs if the input is '/home/tesla/.Tesla/crashlogs', or syslogs if the input is '/var/log/syslog'\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-SYSLOGS\":{\"name\":\"List Syslogs\",\"task\":\"TEST-BASH_ICE_X_LIST-SYSLOGS\",\"description\":\"List logs files in the input directory. This is a simple task and only works for TAI64-encoded log files such as each the log type in the /var/log directory (syslog, klog, ofono, etc.). It will not list other types of files. This may be useful for determining which log files are the most recent. This task does not provide details such as last-modified date. For that info, use the 'List Directory Contents' task. Log files other than 'current' are TAI64-encoded and have names like @400000005c420bfd0f4ec12c.s\",\"inputs\":[\"'inputDirectory' is the location to check for log files. The most common inputs are '/var/log/syslog' and '/var/log/klog'. Always use the absolute path, simply typing 'syslog' will not work.\",\"'numFiles' is the maximum number of files to list, starting with the most recent. If there are 10 files in /var/log/klog and numFiles is 3, this Task will respond with the 3 most recent files.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-PANICLOGS\":{\"name\":\"List Paniclogs\",\"task\":\"TEST-BASH_ICE_X_LIST-PANICLOGS\",\"description\":\"List all of the kernel panic logs on the ICE. Kernel panic occur when the computer (BMP) encounters a memory or driver error. These 'panics' may result in a center display reboot. The timestamp of the kernel panic is in the filename, making this Task useful for quickly checking a kernel panic occurred around a given time. Note that these timestamps are always PDT.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-DRIVENOTES\":{\"name\":\"List Drivenotes\",\"task\":\"TEST-BASH_ICE_X_LIST-DRIVENOTES\",\"description\":\"List all of the drivenotes on the ICE. Drivenotes are triggered by certain important events, including when the driver submits a bug report. The timestamp of the note is in the filename, making this Task useful for quickly checking if a drivenote was taken around a given time. Note that these timestamps are always PDT.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-CRASHLOGS\":{\"name\":\"List Crashlogs\",\"task\":\"TEST-BASH_ICE_X_LIST-CRASHLOGS\",\"description\":\"List all of the process crashlogs on the ICE, such as 'qtcar', 'qtcar-bluetooth', or 'audiod'. These crashlogs are created when a UI process hits an unrecoverable error or freezes. The timestamp of the crash is in the filename, making this Task useful for quickly checking if there was a crash around a given time. Note that these timestamps are always PDT.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_DF\":{\"name\":\"Check Disk Free\",\"task\":\"TEST-BASH_ICE_X_DF\",\"description\":\"Lists the amount of free disk space on each partition, such as /home and /var. This is a useful check in case logs indicate a disk space issue or the center display has rebooted.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-SYSTEM\":{\"name\":\"Check system health\",\"task\":\"TEST-BASH_ICE_X_CHECK-SYSTEM\",\"description\":\"Run a high level filesystem check for devices and volumes. This command shows mounted disks, available disk space, and some volume metadata. The most helpful information here is the disk usage on /home and /var.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-NAVIGATION\":{\"name\":\"Check navigation\",\"task\":\"TEST-BASH_ICE_X_CHECK-NAVIGATION\",\"description\":\"Run high level routine that outputs system information related to navigation. A 'pass' only means the rountine ran does not indicate if an issue is present.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-DISK-USAGE\":{\"name\":\"Check Disk Usage\",\"task\":\"TEST-BASH_ICE_X_CHECK-DISK-USAGE\",\"description\":\"Check the disk usage within several specific directories. Use this task when the filesystem is running low on free disk space (see Check Disk Free). The results will include a number in Megabytes for each directory.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-DATABASES\":{\"name\":\"Check Databases\",\"task\":\"TEST-BASH_ICE_X_CHECK-DATABASES\",\"description\":\"Check the pragma integrity of all the user databases. This will attempt to detect corrupt or damaged databases. If successful, this test will Pass but does not have any other output. If an error is detected, it will specify the offending database.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CAR-STATUS\":{\"name\":\"Check Car Status\",\"task\":\"TEST-BASH_ICE_X_CAR-STATUS\",\"description\":\"Determine the state of the vehicle, such as whether or not a driver is present or the display is on. This is particularly useful to ensure the vehicle is in an acceptable state before performing a remote repair.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_WIFI-ENABLE\":{\"name\":\"Enable Service WIFI\",\"task\":\"PROC_ICE_X_WIFI-ENABLE\",\"description\":\"Runs a script that enables the vehicle to connect to service WiFi.\",\"inputs\":[],\"usr_impact\":\"Allow the vehicle to connect to Tesla Service WiFi.\"},\"PROC_ICE_X_WIFI-DISABLE\":{\"name\":\"Disable Service WIFI\",\"task\":\"PROC_ICE_X_WIFI-DISABLE\",\"description\":\"Runs a script that disables the vehicle from connecting to service WiFi. This may be helpful is WiFi issues are causing unstable connectivity.\",\"inputs\":[],\"usr_impact\":\"Prevents the vehicle from connecting to Tesla Service WiFI.\"},\"PROC_ICE_X_WAKE-DISPLAY\":{\"name\":\"Wake the display\",\"task\":\"PROC_ICE_X_WAKE-DISPLAY\",\"description\":\"Request that the display turn on by simulating a touch event.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns on the display(s).\"},\"PROC_ICE_X_SET-DATA-VALUE-PARKED\":{\"name\":\"Set Datavalue\",\"task\":\"PROC_ICE_X_SET-DATA-VALUE-PARKED\",\"description\":\"Set a datavalue to a specific value on the ICE. This is used to help owners exit Valet mode, toggle speed limits, etc... This Task may only be run while the vehicle is parked.\",\"inputs\":[\"'DataValueName' is the name of the datavalue, such as 'GUI_mobileAccessEnabled'\",\"'DataValueInput' is the value you want to set, such as 'true' or '0'\"],\"usr_impact\":\"WARNING! Some datavalues will impact car behavior.\"},\"PROC_ICE_X_SET-APN\":{\"name\":\"Set APN\",\"task\":\"PROC_ICE_X_SET-APN\",\"description\":\"Set the APN which is used by the modem to connect to the cellular network. Do not use this command without specific guidance. This command uses both the CarAPI and updates the local cell_apn file.\",\"inputs\":[\"'inputApn' is the new APN to set.\"],\"usr_impact\":\"WARNING! Interrupts connectivity. If misused, connetivity may not return.\"},\"PROC_ICE_X_RESET-VALET-PIN\":{\"name\":\"Reset Valet Mode PIN\",\"task\":\"PROC_ICE_X_RESET-VALET-PIN\",\"description\":\"Reset Valet Mode PIN to '0000'. This is intended for assisting customers who have forgotten their PINs and should not be used without customer consent. Be sure to inform the customer of the new PIN.\",\"inputs\":[],\"usr_impact\":\"Valet Mode password changes\"},\"PROC_ICE_X_RESET-TRIAL\":{\"name\":\"Reset Autopilot Trial\",\"task\":\"PROC_ICE_X_RESET-TRIAL\",\"description\":\"Reset the Autopilot trial so that the vehicle becomes eligible for a new one. New trials are issued once daily, so changes may take up to 24hrs. If the vehicle is ineligible for a trial for any reason other than expirtation, this Task will not help.\",\"inputs\":[],\"usr_impact\":\"WARNING! Reboots the gateway.\"},\"PROC_ICE_X_RESET-SPEEDLIMIT-PIN\":{\"name\":\"Reset Chill Mode PIN\",\"task\":\"PROC_ICE_X_RESET-SPEEDLIMIT-PIN\",\"description\":\"Reset Chill Mode PIN to '0000', also known as Speedlimit Mode. This is intended for assisting customers who have forgotten their PINs and should not be used without customer consent. Be sure to inform the customer of the new PIN.\",\"inputs\":[],\"usr_impact\":\"Chill Mode password changes\"},\"PROC_ICE_X_RESET-PIN-TO-DRIVE\":{\"name\":\"Reset Pin-To-Drive\",\"task\":\"PROC_ICE_X_RESET-PIN-TO-DRIVE\",\"description\":\"Reset Pin-to-Drive to '0000'. This is intended for assisting customers who have forgotten their PINs and should not be used without customer consent. Be sure to inform the customer of the new PIN.\",\"inputs\":[],\"usr_impact\":\"Pin-To-Drive password changes.\"},\"PROC_ICE_X_RESET-MAP-OFFSETS\":{\"name\":\"Reset map offsets\",\"task\":\"PROC_ICE_X_RESET-MAP-OFFSETS\",\"description\":\"Reset map download progress by deleting any files in the /var/etc/map-updater/BANK* directories that have the word 'partial' in the filename. This resolves map updates that are stalled due to offset mismatches.\",\"inputs\":[],\"usr_impact\":\"All progress on a map update will be lost. Do not run this while a map update is in progress.\"},\"PROC_ICE_X_REQUEST-HVAC-OFF\":{\"name\":\"Set HVAC off\",\"task\":\"PROC_ICE_X_REQUEST-HVAC-OFF\",\"description\":\"Turn off the HVAC.\",\"inputs\":[],\"usr_impact\":\"Turns off HVAC.\"},\"PROC_ICE_X_REBOOT\":{\"name\":\"Reboot the ICE\",\"task\":\"PROC_ICE_X_REBOOT\",\"description\":\"Request that the ICE reboot immediately, do not use this when the vehicle is in use.\",\"inputs\":[],\"usr_impact\":\"WARNING! Reboots the car computer.\"},\"PROC_ICE_X_READ-GW-FILE\":{\"name\":\"Check Gateway file\",\"task\":\"PROC_ICE_X_READ-GW-FILE\",\"description\":\"Read a file from the gateway. This may be useful to fetch the UDS Debug log in the event that it fails to upload for some reason. Ensure the exact name of the file is used.\",\"inputs\":[\"'getFile' is the exact name of the file to read.\"],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_READ-GW-CONFIGS\":{\"name\":\"Check Gateway Configuration\",\"task\":\"PROC_ICE_X_READ-GW-CONFIGS\",\"description\":\"Read the vehicle configuration codes directly from the gateway. These codes are useful for confirming the exact configuration in the gateway, but are not easy to translate into plain language.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_PROFILE-RESTORE\":{\"name\":\"Profile Restore\",\"task\":\"PROC_ICE_X_PROFILE-RESTORE\",\"description\":\"Restore the user profile data from a pre-existing backup. The vehicle must have connectivity and be online in Garage for this process to work. Depending on the size of the backup and the network signal strength, the process may take between 30 seconds and 3 minutes. A backup file must already exist on the server. If the restore process is successful, the backup is deleted. Multiple UI processes will be restarted upon completion.\",\"inputs\":[],\"usr_impact\":\"WARNING! Center display will restart.\"},\"PROC_ICE_X_PROFILE-BACKUP\":{\"name\":\"Profile Backup\",\"task\":\"PROC_ICE_X_PROFILE-BACKUP\",\"description\":\"Create a backup of all user profile data such as UI Settings, driver profiles and media player favorites. The data is encrypted and uploaded directly to a secure server. The vehicle must have connectivity and be online in Garage for this process to work. Depending on the size of the backup and the network signal strength, the process may take between 30 seconds and 3 minutes.\",\"inputs\":[],\"usr_impact\":\"Depending on bandwidth, this may cause streaming services to lag or skip.\"},\"PROC_ICE_X_POST-FUSING\":{\"name\":\"Model3 Post-Fusing\",\"task\":\"PROC_ICE_X_POST-FUSING\",\"description\":\"Remove any factory-related files from the computer. Use this if messages like 'Factory Network' or 'Factory Mode' are shown on the screen.\",\"inputs\":[],\"usr_impact\":\"WARNING! Reboots the center display\"},\"PROC_ICE_X_MV-ICE-DATABASE\":{\"name\":\"Move Database\",\"task\":\"PROC_ICE_X_MV-ICE-DATABASE\",\"description\":\"Stop a UI process, move the corresponding database, and restart the process. This is helpful for resolving database corruption issues that lead to unexpected UI behavior, including center display restart or flickering. When a process is stopped, functionality will be impacted. The vehicle may lose connectivity or the display may go blank. Once the process is restarted, a new database will automatically be created. This process will delete any settings in a particular database.\",\"inputs\":[\"'targetDb' is the database/process pair that will be reset, such as 'QtCarSettings.db' or 'QtCarBluetoothSettings.db'.\"],\"usr_impact\":\"WARNING! Settings will be deleted and the center display may restart.\"},\"PROC_ICE_X_LDVS\":{\"name\":\"Check Datavalues\",\"task\":\"PROC_ICE_X_LDVS\",\"description\":\"List datavalues matching the name provided. Use the * character as a wildcard, such as CONN_* to fetch all datavalues beginning with CONN_. The most useful datavalues start with GUI_ and describe the value of user settings. Refine your search as much as possible to avoid getting too much output.\",\"inputs\":[\"'inputDv' is the text to search for in datavalues. The only acceptable special characters are * - _\"],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_KEEP-AWAKE\":{\"name\":\"Set keep-awake timer\",\"task\":\"PROC_ICE_X_KEEP-AWAKE\",\"description\":\"Request that the vehicle stay awake for 15 minutes.\",\"inputs\":[],\"usr_impact\":\"Delays vehicle sleep.\"},\"PROC_ICE_X_ICE-SCREENSHOT\":{\"name\":\"Take a screenshot on ICE\",\"task\":\"PROC_ICE_X_ICE-SCREENSHOT\",\"description\":\"Take a screenshot on the ICE. These files are stored internally and may be uploaded using 'Grablogs' on Garage.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_ICE-PROC-STATUS\":{\"name\":\"Check Process status\",\"task\":\"PROC_ICE_X_ICE-PROC-STATUS\",\"description\":\"Query the status of a process running on the ICE. Running processes will reply with 'run' followed by the Process Identifier (PID).\",\"inputs\":[\"'inputProcess' is the process whose status will be returned\"],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_GATEWAY-REBOOT\":{\"name\":\"Reboot gateway\",\"task\":\"PROC_ICE_X_GATEWAY-REBOOT\",\"description\":\"Reboot the gateway immediately, ignoring display states.\",\"inputs\":[],\"usr_impact\":\"WARNING! Never run this when the vehicle is in use!\"},\"PROC_ICE_X_FORMAT-SD-CARD\":{\"name\":\"Format Gateway microSD card\",\"task\":\"PROC_ICE_X_FORMAT-SD-CARD\",\"description\":\"This runs a command that detects if there are SD card alerts in vitals, and if so will format the gateway SD card and then reboot the gateway. If no approved alerts are present, the format will not run.\",\"inputs\":[],\"usr_impact\":\"WARNING! Deletes gateway logs and reboots gateway\"},\"PROC_ICE_X_EXIT-TRANSPORT-MODE\":{\"name\":\"Exit Transport Mode\",\"task\":\"PROC_ICE_X_EXIT-TRANSPORT-MODE\",\"description\":\"Exit Service Mode on the center display. This mode is used to optimize energy usage and connectivity during transportation. Once delivered, a vehicle should never be in Transport Mode.\",\"inputs\":[],\"usr_impact\":\"Red 'Transport mode' banner will disappear.\"},\"PROC_ICE_X_EXIT-SERVICE-MODE\":{\"name\":\"Exit Service Mode\",\"task\":\"PROC_ICE_X_EXIT-SERVICE-MODE\",\"description\":\"Exit Service Mode on the center display. All vehicles in repair have Service Mode removed prior to being returned to their owners.\",\"inputs\":[],\"usr_impact\":\"Red 'Service mode' banner will disappear.\"},\"PROC_ICE_X_EXIT-DIAGNOSTIC-MODE\":{\"name\":\"Exit Diagnostic Mode\",\"task\":\"PROC_ICE_X_EXIT-DIAGNOSTIC-MODE\",\"description\":\"Exit Diagnostic mode.\",\"inputs\":[],\"usr_impact\":\"WARNING! Reboots the center display.\"},\"PROC_ICE_X_EXIT-DEVELOPER-MODE\":{\"name\":\"Exit Developer Mode\",\"task\":\"PROC_ICE_X_EXIT-DEVELOPER-MODE\",\"description\":\"Exit Developer mode.\",\"inputs\":[],\"usr_impact\":\"WARNING! Reboots the center display.\"},\"PROC_ICE_X_ENTER-SERVICE-MODE\":{\"name\":\"Enter Service Mode\",\"task\":\"PROC_ICE_X_ENTER-SERVICE-MODE\",\"description\":\"This will enable Service Mode on the UI and should only be used in Service Centers. This Task may be helpful if other methods are not working.\",\"inputs\":[],\"usr_impact\":\"WARNING! 'Service Mode' displayed on-screen, functionality restricted.\"},\"PROC_ICE_X_ENTER-DIAGNOSTIC-MODE\":{\"name\":\"Enter diagnostic mode\",\"task\":\"PROC_ICE_X_ENTER-DIAGNOSTIC-MODE\",\"description\":\"Request that the UI enter Diagnostic mode.\",\"inputs\":[],\"usr_impact\":\"Enters Diagnostic mode.\"},\"PROC_ICE_X_ENABLE-MOBILE-APP\":{\"name\":\"Enable Mobile App\",\"task\":\"PROC_ICE_X_ENABLE-MOBILE-APP\",\"description\":\"Enable mobile app access to the vehicle. This may be helpful for direct-to-home deliveries or after-hours pickups. Note that mobile access may be deliberately disabled while the vehicle is in Service Mode and this Task will not change that.\",\"inputs\":[],\"usr_impact\":\"Mobile access will be enabled.\"},\"PROC_ICE_X_DISABLE-PIN-TO-DRIVE\":{\"name\":\"Disable Pin-To-Drive\",\"task\":\"PROC_ICE_X_DISABLE-PIN-TO-DRIVE\",\"description\":\"Disable Pin-to-Drive so that service personnel can move a vehicle. This may be necessary if a geofence-related issue has prevented the vehicle from entering Service Mode. Use this command cautiously and remember to later re-enable Pin-To-Drive.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-UPDATER-BACKUPS\":{\"name\":\"Clear Updater Backups\",\"task\":\"PROC_ICE_X_CLEAR-UPDATER-BACKUPS\",\"description\":\"Clear all updater backups from the ICE. This Task will only run if the filesystem has run out of inodes, otherwise it will cancel.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-SERVICE-ALERT\":{\"name\":\"Clear service alert from display\",\"task\":\"PROC_ICE_X_CLEAR-SERVICE-ALERT\",\"description\":\"Clear the service alert bit that causes the on-screen warning 'Contact Tesla Service'\",\"inputs\":[],\"usr_impact\":\"Removes on-screen alert.\"},\"PROC_ICE_X_CLEAR-SCREENSHOTS\":{\"name\":\"Clear Screenshots\",\"task\":\"PROC_ICE_X_CLEAR-SCREENSHOTS\",\"description\":\"Clear all screenshots from the ICE. This task will report failure if there are no screenshots to delete.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-MAP-CACHE\":{\"name\":\"Clear ICE map cache\",\"task\":\"PROC_ICE_X_CLEAR-MAP-CACHE\",\"description\":\"Delete the map tiles cache specifically. This task will report failure if there is no map tiles cache.\",\"inputs\":[],\"usr_impact\":\"Map tiles must be re-downloaded.\"},\"PROC_ICE_X_CLEAR-CACHE\":{\"name\":\"Clear ICE caches\",\"task\":\"PROC_ICE_X_CLEAR-CACHE\",\"description\":\"Delete caches from the computer, such as map tiles. This can help clear space on the filesystem.\",\"inputs\":[],\"usr_impact\":\"Map tiles and Media images must be re-downloaded.\"},\"PROC_ICE_X_CLEAR-AUDIO-LOGS\":{\"name\":\"Clear Audio Logs\",\"task\":\"PROC_ICE_X_CLEAR-AUDIO-LOGS\",\"description\":\"Clear all audio logs from the ICE. This task will report failure if there are no audio logs.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-APE-CACHE\":{\"name\":\"Clear APE cache\",\"task\":\"PROC_ICE_X_CLEAR-APE-CACHE\",\"description\":\"Delete the ape updater package from the computer. This is necessary when the updater package has been corrupted and causes firmware failures.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_DI_X_READ-DI-ROTATIONS\":{\"name\":\"Read rotations from Drive Unit\",\"task\":\"PROC_DI_X_READ-DI-ROTATIONS\",\"description\":\"Read the number of rotations recorded by the Drive Unit throughout its lifetime. This number is used to determine the distance shown on the Odometer. This task may be necessary when resolving issues with DI Initialization or fixing a UI Odometer problem. This routine uses UDS to communicate with the DI, therefore it will try to set the Accessory-Plus power state.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_DAS_X_CLEAR-CALIBRATION\":{\"name\":\"Clear DAS Calibration\",\"task\":\"PROC_DAS_X_CLEAR-CALIBRATION\",\"description\":\"Erase DAS camera calibration\",\"inputs\":[],\"usr_impact\":\"WARNING! Impacts Autopilot.\"},\"PROC_DAS-GPS-RESET\":{\"name\":\"Reset GPS\",\"task\":\"PROC_DAS-GPS-RESET\",\"description\":\"Reset the GPS module on the DAS ecu.\",\"inputs\":[],\"usr_impact\":\"WARNING! May disrupt navigation briefly.\"},\"PROC-BASH_ICE_X_FORCE-ICE-UPDATER-HANDSHAKE\":{\"name\":\"Force ICE updater handshake\",\"task\":\"PROC-BASH_ICE_X_FORCE-ICE-UPDATER-HANDSHAKE\",\"description\":\"Forces the updater to handshake with Garage from the car side. This is helpful where a car is online in Garage but the update is stuck on the 'handshaking' step. After running this, check the garage firmware job status page for updates.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PING-TP_DAS\":{\"name\":\"Selftest ping DAS\",\"task\":\"PING-TP_DAS\",\"description\":\"Checks if the DAS ECU is connected and powered. This is not expected to pass unless the DAS ECU is awake, which request the accessory rail to be on.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PING-BASH_WIFI-STATUS\":{\"name\":\"Selftest wifi status\",\"task\":\"PING-BASH_WIFI-STATUS\",\"description\":\"Check the current WiFi connection status of the vehicle. This command will always pass. It reports: bssid, rssi, noise, snr and chanspec.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PING-BASH_USB\":{\"name\":\"Selftest USB\",\"task\":\"PING-BASH_USB\",\"description\":\"Runs a script that checks if the USB hub is powered and connected.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns the display(s) on.\"},\"PING-BASH_TUNER\":{\"name\":\"Selftest Tuner\",\"task\":\"PING-BASH_TUNER\",\"description\":\"Power the tuner and check antenna connections and voltages.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns the display(s) on.\"},\"PING-BASH_SIM\":{\"name\":\"Selftest check SIM\",\"task\":\"PING-BASH_SIM\",\"description\":\"Check if the SIM card is reporting an ICCID properly and whether the modem is using the internal e-SIM (EUICC) or external (2FF) SIM card.\",\"inputs\":[],\"usr_impact\":\"WARNING! Disrupts cell connectivity during the test (ofono is restarted).\"},\"PING-BASH_MODEM_HEALTH_CHECK\":{\"name\":\"Selftest modem health\",\"task\":\"PING-BASH_MODEM_HEALTH_CHECK\",\"description\":\"Checks if the car computer can communicate with the LTE modem and that the associated processes are up, and then run the LTE self test.\",\"inputs\":[],\"usr_impact\":\"WARNING! Disrupts cell connectivity during the test (ofono is restarted).\"},\"PING-BASH_LTE\":{\"name\":\"Selftest LTE\",\"task\":\"PING-BASH_LTE\",\"description\":\"Check the LTE modem antennas and both SIM card ICCIDs (internal and external).\",\"inputs\":[],\"usr_impact\":\"WARNING! Disrupts cell connectivity during the test.\"},\"PING-BASH_DISPLAY_POWER_ON\":{\"name\":\"Set display power on\",\"task\":\"PING-BASH_DISPLAY_POWER_ON\",\"description\":\"Request that Power Manager turn the display on.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns on display.\"},\"PING-BASH_DISPLAY_POWER_OFF\":{\"name\":\"Set display power off\",\"task\":\"PING-BASH_DISPLAY_POWER_OFF\",\"description\":\"Request that Power Manager turn the display off.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns off display even when the vehicle is occupied.\"},\"PING-BASH_DISPLAY\":{\"name\":\"Selftest display\",\"task\":\"PING-BASH_DISPLAY\",\"description\":\"Checks if the car computer can communicate with the display. This may be a helpful check if the display is stuck in a blank state.\",\"inputs\":[],\"usr_impact\":\"WARNING! Display will be rebooted.\"},\"PING-BASH_CELLCONN\":{\"name\":\"Selftest cell connectivity\",\"task\":\"PING-BASH_CELLCONN\",\"description\":\"Runs a script that checks if the modem is up, and if so runs the check-internet script which checks if the vehicle can access the internet.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PING-BASH_BT-WIFI\":{\"name\":\"Selftest Bluetooth and Wifi\",\"task\":\"PING-BASH_BT-WIFI\",\"description\":\"Run a script that checks the Bluetooth and WiFi antenna  connections.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PING-BASH_ANT\":{\"name\":\"Selftest antennas\",\"task\":\"PING-BASH_ANT\",\"description\":\"Run a script that checks the LTE antenna connects.\",\"inputs\":[],\"usr_impact\":\"WARNING! Disrupts cell connectivity during the test (ofono is restarted).\"}},\"model_sx\":{\"TEST-BASH_ICE_X_UPDATER-STATUS\":{\"name\":\"Check Updater status\",\"task\":\"TEST-BASH_ICE_X_UPDATER-STATUS\",\"description\":\"Check the status directly on an updater. This returns firmware package data including signatures, fail counts, fuse state and more. Ensure the target updater is awake before running this.\",\"inputs\":[\"'targetUpdater' is the host whose status will be returned.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-UI-ALERTS\":{\"name\":\"Check UI Alerts\",\"task\":\"TEST-BASH_ICE_X_SEARCH-UI-ALERTS\",\"description\":\"Check recent syslogs for all UI alerts. Some alerts are benign, such as seatbelt reminders, but others may represent service concerns. This Task will find all UI alerts along with when each occurred. Note that these timestamps are always PDT.\",\"inputs\":[\"'numFiles' is the number of log files to search through. Use 'List Syslogs' to narrow down the time period, fewer logs is faster. Logs start with the most recent.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-SYSLOGS\":{\"name\":\"Search Syslogs\",\"task\":\"TEST-BASH_ICE_X_SEARCH-SYSLOGS\",\"description\":\"Search recent syslogs for a keyword or pattern. This Task is optimized for very specific keywords and should not be used for broad queries such as 'bluetooth' or 'modem'. Note that these timestamps are always PDT.\",\"inputs\":[\"'directory' is the location of the syslogs to search. /var/log/syslog is the default, but anything is /var/log is allowed.\",\"'numFiles' is the number of log files to search through. Use 'List Syslogs' to narrow down the time period, fewer logs is faster. Logs start with the most recent.\",\"'parameters' is an optional input for advanced users, it's best to leave it as default\",\"'search' is the keyword or pattern to search for, such as 'connection timed out' or 'crashing QtCar'. Special characters will be rejected by the vehicle.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-PANICLOG\":{\"name\":\"Search a Paniclog\",\"task\":\"TEST-BASH_ICE_X_SEARCH-PANICLOG\",\"description\":\"Search one panic log for a keyword or pattern.\",\"inputs\":[\"'inputArgs' is an optional input for advanced users, it's best to leave it as default\",\"'inputFile' is the name of the panic log to read, such as 'kernel-panic-20180506183204-2.tgz'. Do not include the path.\",\"'inputPattern' is the key word or expression to search for, such as 'Fatal exception' or 'OOPS'. Special characters will be rejected by the vehicle.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_SEARCH-CRASHLOG\":{\"name\":\"Search a Crashlog\",\"task\":\"TEST-BASH_ICE_X_SEARCH-CRASHLOG\",\"description\":\"Search one UI process crashlog for a keyword or pattern.\",\"inputs\":[\"'inputArgs' is an optional input for advanced users, it's best to leave it as default\",\"'inputFile' is the name of the crashlog to read. Use 'List Crashlogs' to find files. Do not include the path.\",\"'inputPattern' is the key word or expression to search for, such as 'ASSERTION FAILED' or 'Lost connection to gateway'. Special characters will be rejected by the vehicle.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_READ-VAR-PARAMS\":{\"name\":\"Check Var Data\",\"task\":\"TEST-BASH_ICE_X_READ-VAR-PARAMS\",\"description\":\"Read the parameters from the ICE filesystem's /var metablock. This will provide insight into filesystem-related issues such as insufficient inodes or disk space. The most helpful result is the 'Free Inodes' line which should show a number over 10,000.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_READ-SX-GW-CFG\":{\"name\":\"Check Gateway Configuration\",\"task\":\"TEST-BASH_ICE_X_READ-SX-GW-CFG\",\"description\":\"Read the full configuration file on the gateway. These settings represent hardware features on the vehicle, such as roof glass and battery variant, in addition to paid features like Autopilot. This Task is similar to Teleforce 'dgc'. It reads directly from the gateway and may be trusted as the best point of reference\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_READ-HOME-PARAMS\":{\"name\":\"Check Home Data\",\"task\":\"TEST-BASH_ICE_X_READ-HOME-PARAMS\",\"description\":\"Read the parameters from the ICE filesystem's /home metablock. This will provide insight into filesystem-related issues such as insufficient inodes or disk space. The most helpful result is the 'Free Inodes' line which should show a number over 10,000.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LS\":{\"name\":\"List Directory Contents\",\"task\":\"TEST-BASH_ICE_X_LS\",\"description\":\"List the contents of a directory. This is flexible and may be used to explore the filesystem. However, this Task has limited permissions and will not be able to read all directories.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\",\"'inputDirectory' is the directory to list. This must be an absolute path and does not support any special characters. This can list crashlogs if the input is '/home/tesla/.Tesla/crashlogs', or syslogs if the input is '/var/log/syslog'\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-SYSLOGS\":{\"name\":\"List Syslogs\",\"task\":\"TEST-BASH_ICE_X_LIST-SYSLOGS\",\"description\":\"List logs files in the input directory. This is a simple task and only works for TAI64-encoded log files such as each the log type in the /var/log directory (syslog, klog, ofono, etc.). It will not list other types of files. This may be useful for determining which log files are the most recent. This task does not provide details such as last-modified date. For that info, use the 'List Directory Contents' task. Log files other than 'current' are TAI64-encoded and have names like @400000005c420bfd0f4ec12c.s\",\"inputs\":[\"'inputDirectory' is the location to check for log files. The most common inputs are /var/log/syslog and /var/log/klog. Always use the absolute path, simply typing 'syslog' will not work.\",\"'numFiles' is the maximum number of files to list, starting with the most recent. If there are 10 files in /var/log/klog and numFiles is 3, this Task will respond with the 3 most recent files.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-PANICLOGS\":{\"name\":\"List Paniclogs\",\"task\":\"TEST-BASH_ICE_X_LIST-PANICLOGS\",\"description\":\"List all of the kernel panic logs on the ICE. Kernel panic occur when the computer (BMP) encounters a memory or driver error. These 'panics' may result in a center display reboot. The timestamp of the kernel panic is in the filename, making this Task useful for quickly checking a kernel panic occurred around a given time. Note that these timestamps are always PDT.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-DRIVENOTES\":{\"name\":\"List Drivenotes\",\"task\":\"TEST-BASH_ICE_X_LIST-DRIVENOTES\",\"description\":\"List all of the drivenotes on the ICE. Drivenotes are triggered by certain important events, including when the driver submits a bug report. The timestamp of the note is in the filename, making this Task useful for quickly checking if a drivenote was taken around a given time. Note that these timestamps are always PDT.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_LIST-CRASHLOGS\":{\"name\":\"List Crashlogs\",\"task\":\"TEST-BASH_ICE_X_LIST-CRASHLOGS\",\"description\":\"List all of the process crashlogs on the ICE, such as 'qtcar', 'qtcar-bluetooth', or 'audiod'. These crashlogs are created when a UI process hits an unrecoverable error or freezes. The timestamp of the crash is in the filename, making this Task useful for quickly checking if there was a crash around a given time. Note that these timestamps are always PDT.\",\"inputs\":[\"'details' is an optional flag to include file ownership, size, modified date and more. False will only return file names.\"],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-SYSTEM\":{\"name\":\"Check system health\",\"task\":\"TEST-BASH_ICE_X_CHECK-SYSTEM\",\"description\":\"Run a high level filesystem check for devices and volumes. This command shows mounted disks, available disk space, and some volume metadata. The most helpful information here is the disk usage on /home and /var.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-DISK-USAGE\":{\"name\":\"Check Disk Usage\",\"task\":\"TEST-BASH_ICE_X_CHECK-DISK-USAGE\",\"description\":\"Check the disk usage within several specific directories. Use this task when the filesystem is running low on free disk space (see Check Disk Free). The results will include a number in Megabytes for each directory.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CHECK-DATABASES\":{\"name\":\"Check Databases\",\"task\":\"TEST-BASH_ICE_X_CHECK-DATABASES\",\"description\":\"Check the pragma integrity of all the user databases. This will attempt to detect corrupt or damaged databases. If successful, this test will Pass but does not have any other output. If an error is detected, it will specify the offending database.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_ICE_X_CAR-STATUS\":{\"name\":\"Check Car Status\",\"task\":\"TEST-BASH_ICE_X_CAR-STATUS\",\"description\":\"Determine the state of the vehicle, such as whether or not a driver is present or the display is on. This is particularly useful to ensure the vehicle is in an acceptable state before performing a remote repair.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"TEST-BASH_CID_X_TUNER-ANTENNA-US-PREMIUM\":{\"name\":\"Tuner selftest - Premium\",\"task\":\"TEST-BASH_CID_X_TUNER-ANTENNA-US-PREMIUM\",\"description\":\"Check the premium-audio tuner and report antenna voltages. This requires powering the MCU.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns on displays and reboots tuner.\"},\"TEST-BASH_CID_X_TUNER-ANTENNA-US-BASE\":{\"name\":\"Tuner selftest - Base\",\"task\":\"TEST-BASH_CID_X_TUNER-ANTENNA-US-BASE\",\"description\":\"Check the base-audio tuner and report antenna voltages. This requires powering the MCU.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns on displays and reboots tuner.\"},\"PROC_ICE_X_WAKE-DISPLAY\":{\"name\":\"Wake the display\",\"task\":\"PROC_ICE_X_WAKE-DISPLAY\",\"description\":\"Request that the display turn on by simulating a touch event.\",\"inputs\":[],\"usr_impact\":\"WARNING! Turns on the display(s).\"},\"PROC_ICE_X_SET-DATA-VALUE-PARKED\":{\"name\":\"Set Datavalue\",\"task\":\"PROC_ICE_X_SET-DATA-VALUE-PARKED\",\"description\":\"Set a datavalue to a specific value on the ICE. This is used to help owners exit Valet mode, toggle speed limits, etc... This Task may only be run while the vehicle is parked.\",\"inputs\":[\"'DataValueName' is the name of the datavalue, such as 'GUI_mobileAccessEnabled'\",\"'DataValueInput' is the value you want to set, such as 'true' or '0'\"],\"usr_impact\":\"WARNING! Some datavalues will impact car behavior.\"},\"PROC_ICE_X_SET-APN\":{\"name\":\"Set APN\",\"task\":\"PROC_ICE_X_SET-APN\",\"description\":\"Set the APN which is used by the modem to connect to the cellular network. Do not use this command without specific guidance. This command uses both the CarAPI and updates the local cell_apn file.\",\"inputs\":[\"'inputApn' is the new APN to set.\"],\"usr_impact\":\"WARNING! Interrupts connectivity. If misused, connetivity may not return.\"},\"PROC_ICE_X_RESET-VALET-PIN\":{\"name\":\"Reset Valet Mode PIN\",\"task\":\"PROC_ICE_X_RESET-VALET-PIN\",\"description\":\"Reset Valet Mode PIN to '0000'. This is intended for assisting customers who have forgotten their PINs and should not be used without customer consent. Be sure to inform the customer of the new PIN.\",\"inputs\":[],\"usr_impact\":\"Valet Mode password changes\"},\"PROC_ICE_X_RESET-TRIAL\":{\"name\":\"Reset Autopilot Trial\",\"task\":\"PROC_ICE_X_RESET-TRIAL\",\"description\":\"Reset the Autopilot trial so that the vehicle becomes eligible for a new one. New trials are issued once daily, so changes may take up to 24hrs. If the vehicle is ineligible for a trial for any reason other than expirtation, this Task will not help.\",\"inputs\":[],\"usr_impact\":\"A new trial will be sent, including the trial on-screen popup.\"},\"PROC_ICE_X_RESET-SPEEDLIMIT-PIN\":{\"name\":\"Reset Chill Mode PIN\",\"task\":\"PROC_ICE_X_RESET-SPEEDLIMIT-PIN\",\"description\":\"Reset Chill Mode PIN to '0000', also known as Speedlimit Mode. This is intended for assisting customers who have forgotten their PINs and should not be used without customer consent. Be sure to inform the customer of the new PIN.\",\"inputs\":[],\"usr_impact\":\"Chill Mode password changes\"},\"PROC_ICE_X_RESET-PIN-TO-DRIVE\":{\"name\":\"Reset Pin-To-Drive\",\"task\":\"PROC_ICE_X_RESET-PIN-TO-DRIVE\",\"description\":\"Reset Pin-to-Drive to '0000'. This is intended for assisting customers who have forgotten their PINs and should not be used without customer consent. Be sure to inform the customer of the new PIN.\",\"inputs\":[],\"usr_impact\":\"Pin-To-Drive password changes.\"},\"PROC_ICE_X_RESET-MAP-OFFSETS\":{\"name\":\"Reset map offsets\",\"task\":\"PROC_ICE_X_RESET-MAP-OFFSETS\",\"description\":\"Reset map download progress by deleting any files in the /var/etc/map-updater/BANK* directories that have the word 'partial' in the filename. This resolves map updates that are stalled due to offset mismatches.\",\"inputs\":[],\"usr_impact\":\"All progress on a map update will be lost. Do not run this while a map update is in progress.\"},\"PROC_ICE_X_PROFILE-RESTORE\":{\"name\":\"Profile Restore\",\"task\":\"PROC_ICE_X_PROFILE-RESTORE\",\"description\":\"Restore the user profile data from a pre-existing backup. The vehicle must have connectivity and be online in Garage for this process to work. Depending on the size of the backup and the network signal strength, the process may take between 30 seconds and 3 minutes. A backup file must already exist on the server. If the restore process is successful, the backup is deleted. Multiple UI processes will be restarted upon completion.\",\"inputs\":[],\"usr_impact\":\"WARNING! Center display will restart.\"},\"PROC_ICE_X_PROFILE-BACKUP\":{\"name\":\"Profile Backup\",\"task\":\"PROC_ICE_X_PROFILE-BACKUP\",\"description\":\"Create a backup of all user profile data such as UI Settings, driver profiles and media player favorites. The data is encrypted and uploaded directly to a secure server. The vehicle must have connectivity and be online in Garage for this process to work. Depending on the size of the backup and the network signal strength, the process may take between 30 seconds and 3 minutes.\",\"inputs\":[],\"usr_impact\":\"Depending on bandwidth, this may cause streaming services to lag or skip.\"},\"PROC_ICE_X_MV-ICE-DATABASE\":{\"name\":\"Move Database\",\"task\":\"PROC_ICE_X_MV-ICE-DATABASE\",\"description\":\"Stop a UI process, move the corresponding database, and restart the process. This is helpful for resolving database corruption issues that lead to unexpected UI behavior, including center display restart or flickering. When a process is stopped, functionality will be impacted. The vehicle may lose connectivity or the display may go blank. Once the process is restarted, a new database will automatically be created. This process will delete any settings in a particular database.\",\"inputs\":[\"'targetDb' is the database/process pair that will be reset, such as 'QtCarSettings.db' or 'QtCarBluetoothSettings.db'.\"],\"usr_impact\":\"WARNING! Settings will be deleted and the center display may restart.\"},\"PROC_ICE_X_LDVS\":{\"name\":\"Check Datavalues\",\"task\":\"PROC_ICE_X_LDVS\",\"description\":\"List datavalues matching the name provided. Use the * character as a wildcard, such as CONN_* to fetch all datavalues beginning with CONN_. The most useful datavalues start with GUI_ and describe the value of user settings. Refine your search as much as possible to avoid getting too much output.\",\"inputs\":[\"'inputDv' is the text to search for in datavalues. The only acceptable special characters are * - _\"],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_KEEP-AWAKE\":{\"name\":\"Set keep-awake timer\",\"task\":\"PROC_ICE_X_KEEP-AWAKE\",\"description\":\"Request that the vehicle stay awake for 15 minutes.\",\"inputs\":[],\"usr_impact\":\"Delays vehicle sleep.\"},\"PROC_ICE_X_ICE-SCREENSHOT\":{\"name\":\"Take a screenshot on ICE\",\"task\":\"PROC_ICE_X_ICE-SCREENSHOT\",\"description\":\"Take a screenshot on the MCU. These files are stored internally and may be uploaded using 'Grablogs' on Garage.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_ICE-PROC-STATUS\":{\"name\":\"Check process status\",\"task\":\"PROC_ICE_X_ICE-PROC-STATUS\",\"description\":\"Query the status of a process running on the ICE. Running processes will reply with 'run' followed by the Process Identifier (PID).\",\"inputs\":[\"'inputProcess' is the process whose status will be returned\"],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_IC-SCREENSHOT\":{\"name\":\"Take a screenshot on IC\",\"task\":\"PROC_ICE_X_IC-SCREENSHOT\",\"description\":\"Take a screenshot on the IC. These files are stored internally and may be uploaded using 'Grablogs' on Garage.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_EXIT-TRANSPORT-MODE\":{\"name\":\"Exit Transport Mode\",\"task\":\"PROC_ICE_X_EXIT-TRANSPORT-MODE\",\"description\":\"Exit Service Mode on the center display. This mode is used to optimize energy usage and connectivity during transportation. Once delivered, a vehicle should never be in Transport Mode.\",\"inputs\":[],\"usr_impact\":\"Red 'Transport mode' banner will disappear.\"},\"PROC_ICE_X_EXIT-SERVICE-MODE\":{\"name\":\"Exit Service Mode\",\"task\":\"PROC_ICE_X_EXIT-SERVICE-MODE\",\"description\":\"Exit Service Mode on the center display. All vehicles in repair have Service Mode removed prior to being returned to their owners.\",\"inputs\":[],\"usr_impact\":\"Red 'Service mode' banner will disappear.\"},\"PROC_ICE_X_ENTER-SERVICE-MODE\":{\"name\":\"Enter Service Mode\",\"task\":\"PROC_ICE_X_ENTER-SERVICE-MODE\",\"description\":\"This will enable Service Mode on the UI and should only be used in Service Centers. This Task may be helpful if other methods are not working.\",\"inputs\":[],\"usr_impact\":\"WARNING! 'Service Mode' displayed on-screen, functionality restricted.\"},\"PROC_ICE_X_ENABLE-MOBILE-APP\":{\"name\":\"Enable Mobile App\",\"task\":\"PROC_ICE_X_ENABLE-MOBILE-APP\",\"description\":\"Enable mobile app access to the vehicle. This may be helpful for direct-to-home deliveries or after-hours pickups. Note that mobile access may be deliberately disabled while the vehicle is in Service Mode and this Task will not change that.\",\"inputs\":[],\"usr_impact\":\"Mobile access will be enabled.\"},\"PROC_ICE_X_DISABLE-PIN-TO-DRIVE\":{\"name\":\"Disable Pin-To-Drive\",\"task\":\"PROC_ICE_X_DISABLE-PIN-TO-DRIVE\",\"description\":\"Disable Pin-to-Drive so that service personnel can move a vehicle. This may be necessary if a geofence-related issue has prevented the vehicle from entering Service Mode. Use this command cautiously and remember to later re-enable Pin-To-Drive.\",\"inputs\":[],\"usr_impact\":\"Pin-to-Drive will be disabled\"},\"PROC_ICE_X_CLEAR-UPDATER-BACKUPS\":{\"name\":\"Clear Updater Backups\",\"task\":\"PROC_ICE_X_CLEAR-UPDATER-BACKUPS\",\"description\":\"Clear all updater backups from the ICE. This Task will only run if the filesystem has run out of inodes, otherwise it will cancel.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-SERVICE-ALERT\":{\"name\":\"Clear service alert from display\",\"task\":\"PROC_ICE_X_CLEAR-SERVICE-ALERT\",\"description\":\"Clear the service alert bit that causes the on-screen warning 'Contact Tesla Service'\",\"inputs\":[],\"usr_impact\":\"Removes on-screen alert.\"},\"PROC_ICE_X_CLEAR-SCREENSHOTS\":{\"name\":\"Clear Screenshots\",\"task\":\"PROC_ICE_X_CLEAR-SCREENSHOTS\",\"description\":\"Clear all screenshots from the ICE. This task will report failure if there are no screenshots to delete.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-CACHE\":{\"name\":\"Clear ICE caches\",\"task\":\"PROC_ICE_X_CLEAR-CACHE\",\"description\":\"Delete caches from the computer, such as map tiles. This can help clear space on the filesystem.\",\"inputs\":[],\"usr_impact\":\"Map tiles and Media images must be re-downloaded.\"},\"PROC_ICE_X_CLEAR-AUDIO-LOGS\":{\"name\":\"Clear Audio Logs\",\"task\":\"PROC_ICE_X_CLEAR-AUDIO-LOGS\",\"description\":\"Clear all audio logs from the ICE. This task will report failure if there are no audio logs.\",\"inputs\":[],\"usr_impact\":\"N/A\"},\"PROC_ICE_X_CLEAR-APE-CACHE\":{\"name\":\"Clear APE cache\",\"task\":\"PROC_ICE_X_CLEAR-APE-CACHE\",\"description\":\"Delete the ape updater package from the computer. This is necessary when the updater package has been corrupted and causes firmware failures.\",\"inputs\":[],\"usr_impact\":\"N/A\"}}}");

